import React from 'react';
import './MainComponent.css';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import banner from '../../img/logo-main.png';


const MainComponent = () => {
    return (
        <div>
            <Header />
            <main className='main-container'>
            {/* 1 секция баннер */}
            <section class='main-banner'>
                <div class='banner'>
                    <div className='banner-title' lang="ru">
                        <strong>Социальные опросы</strong>
                    </div>
                    <div class='banner-subtitle'>
                        <p>Основные понятия, информация о видах опросов и для чего они нужны, изменения сроков проведения опросов и публикации новостей</p>
                    </div>
                </div>

                <div class="banner-img">
                    <img style="width: 100%" src={logo} alt="" class="banner-img-img"/>
                </div>
      </section>
            </main>
            <Footer />
        </div>
    );
};

export default MainComponent;
